import React from "react";

function Node() {
    return (
        <div style={nodeStyle}>
            {this.state.value}
        </div>
    );
}

const nodeStyle = {
    height: "50px",
    width: "50px",

    backgroundColor: "#fff",
    borderRadius: "50%",
    border: "1px solid red",

    textAlign: "center",
    display: "flex",
    justifyContent: "center",
    alignItems: "center"
}

export default Node
